sourcesContent:
import mysql from "mysql2";

const pool = mysql.createPool(
  process.env.JAWSDB_URL ?? {
    host: 'localhost',
    user: 'root',
    database: 'WEEK11_INHA_DB',
    password: 'pokm1569*',
    waitForConnections: true,
    connectionLimit: 10,
    queueLimit: 0
  }
);

// async / await 사용
const promisePool = pool.promise();

// selec query
export const selectSql = {
  getUsers: async () => {
    const [rows] = await promisePool.query(`select * from student`);
    return rows;
  },
  //TODO
  getClass: async () => {
    const sql = `SELECT
      c.ID,
     c.Name,
     c.Professor,
     d.Dname,
     c.Number_of_participant,
     c.Number_of_participant - COUNT(cs.Student_Id) AS Remaining_participants
  FROM
     class c
  LEFT JOIN
     department d ON c.Did = d.ID
  LEFT JOIN
     class_student cs ON c.ID = cs.Class_Id
  GROUP BY
     c.ID, c.Cid, c.Name, c.Professor, d.dname, c.Number_of_participant;`;
    const [result] = await promisePool.query(sql);
    return result;
  },
  getClassStudent: async (data) => {
    const sql = `SELECT
    c.ID,
    c.Name,
    c.Professor,
    d.Dname,
    c.Number_of_participant
FROM
    class_student cs
JOIN
     student s ON cs.Student_id = s.ID
JOIN
    class c ON cs.Class_Id = c.ID
JOIN
    department d ON c.Did = d.ID
WHERE
    s.StudentId = ${data}
GROUP BY
    c.ID, c.Cid, c.Name, c.Professor, c.Number_of_participant, d.dname;`;
    const [result] = await promisePool.query(sql);
    return result;
  },
}

export const createSql = {
  addClass: async (data) => {
    const uid = await promisePool.query(`SELECT Id FROM Student WHERE StudentId=${data.sId}`);

    const results = await promisePool.query(`
      INSERT INTO class_student (Student_Id, Class_Id)
      SELECT ${uid[0][0].Id}, ${data.cId}
      FROM class
      WHERE Number_of_participant > 0
          AND NOT EXISTS (
              SELECT 1
              FROM class_student
              WHERE Student_Id = ${uid[0][0].Id} AND Class_Id = ${data.cId}
          )
          AND EXISTS (
              SELECT 1
              FROM class
              WHERE ID = ${data.cId} AND Number_of_participant > 0
          )
      LIMIT 1; 
    `);

    return results[0];
  }
};

