sourcesContent:
import express from "express";
// TODO
// sql import
import { selectSql, createSql } from "../database/sql";


const router = express.Router();

router.get('/', async function (req, res) {
    // TODO
    if (req.cookies.user) {
        const classes = await selectSql.getClassStudent(req.cookies.user);
        const allClass = await selectSql.getClass(req.cookies.user);
        res.render('select', { user: req.cookies.user, classes, allClass });
    } else {
        res.render('/')
    }
});


router.post('/', async(req, res) => {
    // TODO
    const data = {
        cId: req.body.applyBtn,
        sId: req.cookies.user,
    }
    await createSql.addClass(data);

    res.redirect('/sugang');


});

module.exports = router;

